    super(props);
    this.state = {
      users: [],
    };
  }
  render() {
    return (
      <div>
        <label>Your name: </label>
        <input type="text" onChange={this.AddProg}></input>
        <br />
        <br />
        <label>Sort by text: </label>
        <input type="text"></input>
        <br />
        <br />
        <li></li>
      </div>
    );
  }
  AddProg = (e) => {
    const userAdd = e.target.value;
    if (userAgg == "") return;
    console.log(userAdd);
  };
}
